import Usuario from '../modelos/usuario';

export async function crearUsuario(req,res){
    const { username,passwd,primer_nombre,segundo_nombre,primer_apellido,segundo_apellido,direccion_residencia,pais,telefono,estado,codigo_de_descuento,vendedor }=req.body;
    try {
        let newUsuario= await Usuario.create({
            username,
            passwd,
            primer_nombre,
            segundo_nombre,
            primer_apellido,
            segundo_apellido,
            direccion_residencia,
            pais,
            telefono,
            estado,
            codigo_de_descuento,
            vendedor
        },{
            fields: ['username','passwd','primer_nombre','segundo_nombre','primer_apellido','segundo_apellido','direccion_residencia','pais','telefono','estado','codigo_de_descuento','vendedor']
        });
        if(newUsuario){
            return res.json({
                mensaje: 'Usuario creado exitosamente',
                datos: newUsuario
            });
        }
    } catch (error) {
        console.log(error);
        res.status(500).json({
            mensaje: 'no se pudo crear usuario',
            data: {}
        });
    }
    res.send('recibido');
}

export async function loginUsuario(req,res){
    const { username, passwd}= req.body;
    try {
        const busquedaUsuario= await Usuario.findOne({
            attributes: ['username','passwd'],
            where: {
                username: username,
                passwd: passwd
            }
        });
        if(busquedaUsuario){
            return res.json({
                mensaje: 'Usuario encontrado',
                data: busquedaUsuario
            })
        }else{
            return res.json({
                mensaje: 'Usuario no encontrado',
                data: {}
            })
        }
    } catch (error) {
        console.log(error);
    }
}

